import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';

export default function OwnerDashboard() {
    const { isAuthenticated, role } = useSelector((state) => state.auth);

    // Profile state
    const [profile, setProfile] = useState({
        name: '',
        email: '',
        phone: '',
        agencyName: ''
    });
    const [loading, setLoading] = useState(false);
    const [isEditing, setIsEditing] = useState(false);  // Track edit mode

    // Handle form changes
    const handleChange = (e) => {
        const { name, value } = e.target;
        setProfile({ ...profile, [name]: value });
    };

    // Handle the update profile API call
    const handleUpdateProfile = () => {
        setLoading(true);
        fetch(`/api/car-rental-agencies/${profile.agencyId}`, {
            method: 'PUT',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(profile),
        })
            .then((response) => response.json())
            .then((data) => {
                setProfile(data);
                setIsEditing(false); // Switch to view mode after updating
                setLoading(false);
            })
            .catch((error) => {
                console.error('Error updating profile:', error);
                setLoading(false);
            });
    };

    // Fetch the profile data on initial load (optional)
    useEffect(() => {
        if (isAuthenticated) {
            // Fetch profile from the API
            fetch(`/api/car-rental-agencies/profile`)  // Replace with actual API endpoint
                .then((response) => response.json())
                .then((data) => {
                    setProfile(data);
                })
                .catch((error) => console.error('Error fetching profile:', error));
        }
    }, [isAuthenticated]);

    return (
        <div>
            <h2>Owner Dashboard</h2>
            {role?.roleName === 'Agency' && isAuthenticated ? (
                <div>
                    <h3>Profile</h3>
                    {isEditing ? (
                        <div>
                            <label>
                                Name:
                                <input
                                    type="text"
                                    name="name"
                                    value={profile.name}
                                    onChange={handleChange}
                                />
                            </label>
                            <label>
                                Email:
                                <input
                                    type="email"
                                    name="email"
                                    value={profile.email}
                                    onChange={handleChange}
                                />
                            </label>
                            <label>
                                Phone:
                                <input
                                    type="text"
                                    name="phone"
                                    value={profile.phone}
                                    onChange={handleChange}
                                />
                            </label>
                            <label>
                                Agency Name:
                                <input
                                    type="text"
                                    name="agencyName"
                                    value={profile.agencyName}
                                    onChange={handleChange}
                                />
                            </label>
                            <button onClick={handleUpdateProfile} disabled={loading}>
                                {loading ? 'Updating...' : 'Update Profile'}
                            </button>
                            <button onClick={() => setIsEditing(false)}>Cancel</button>
                        </div>
                    ) : (
                        <div>
                            <p><strong>Name:</strong> {profile.name}</p>
                            <p><strong>Email:</strong> {profile.email}</p>
                            <p><strong>Phone:</strong> {profile.phone}</p>
                            <p><strong>Agency Name:</strong> {profile.agencyName}</p>
                            <button onClick={() => setIsEditing(true)}>Edit Profile</button>
                        </div>
                    )}
                </div>
            ) : (
                <p>Please log in as an agency owner.</p>
            )}
        </div>
    );
}
